import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <footer className="footer-section">
      <div className="footer-section-container">
        <p>Uebfaqja u krijua nga <a href="#" target='_blank' rel="noreferrer">Elektro System</a><span> &copy;</span></p>
      </div>
    </footer>
  );
}

export default Footer;
